export let MarqueeDirections;
(function (MarqueeDirections) {
  MarqueeDirections["RIGHT"] = "RIGHT";
  MarqueeDirections["LEFT"] = "LEFT";
  MarqueeDirections["UP"] = "UP";
  MarqueeDirections["DOWN"] = "DOWN";
})(MarqueeDirections || (MarqueeDirections = {}));
